  constructor() {
    super();
    this.state = {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }



  render() {
    return (
      <div className="App">
        <ParticlesOptions />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange}/>
    {/*    <FaceRecognition />*/}
      </div>
    );
  }
}

export default App;
